window.bookSummaryJSON = "<p>How can something so bad for you be so delicious?</p> <p>A popular baker and cake decorator, Bobbi Bright should know better than anyone that not all sweet things are good for you. Still, she can't quit her first love, Noah Laskera completely unserious billionaire adventurer who makes her feel like the only woman in the universeâ€”when he's around. He bails on her constantly, and she's tired of being his second choice.</p> <p>So she makes a plan to quit Noah and get her life back on track. She's going to get married and have children like she always wanted. And to help things along, she heads to a famous local jeweler to pick out a dream ring and manifest her dream husband.</p> <p>Noah has been in love with Bobbi since the moment he laid eyes on her, but a huge secret is keeping him from being completely honest. When he sees her at a jewelry store buying a diamond ring to propose to another man, he realizes he cant let her get married and have babies with anyone else. He embarks on a campaign to win her back, including wooing her cat, who hates everyone.</p> <p>But when she discovers her late fathers papers, she realizes Noah isn't who she thought he was. Hell, she's not even who she thought she was. And the secrets change everything between them.</p> <p>Still Mine is a standalone second chance romance featuring a sexy billionaire with a secret identity and a sassy baker he can never let go.</p>"; 
